import React from 'react';
import DropdownButton from '../components/customComponents/DropdownButton';

const Home: React.FC = () => {

const dropdownOptions = [
{ value: 1, text: 'IBERDROLA' },
{ value: 2, text: 'ENDESA' },
{ value: 3, text: 'GASNATURAL' }
];
  return (
    <div>
      <h2>Please check your Organisation</h2>
      <p>This will display your employees</p>
      <DropdownButton 
          options={dropdownOptions}
        />
    </div>
  );
};

export default Home;
